                <TouchableOpacity style={styles.buttonStyle} onPress={() => alert('Button pressed!')}>
                    <Text style={styles.text}>Click me</Text>
                </TouchableOpacity>

                <TouchableOpacity style={styles.buttonStyle} onPress={() => alert('Button pressed!')}>
                    <Text style={styles.text}>Click me</Text>
                </TouchableOpacity>
            </View>
        </View>
    )
}

export default AutoScreen
